import React, { useState } from 'react';
import '../styles/Competence.css';

const Competence = () => {
  const [currentSlide, setCurrentSlide] = useState({ frontEnd: 0, backEnd: 0, communication: 0 });
  const [activeSection, setActiveSection] = useState('frontEnd');

  const slides = {
      frontEnd: [
          { title: 'JavaScript', description: 'A maior parte da minha experiência com JavaScript foi através do curso da Trybe...', imgSrc: '/images/javascript.png' },
          { title: 'HTML', description: 'Atualmente, considero meu nível em HTML avançado...', imgSrc: '/images/html.png' },
          { title: 'CSS', description: 'Assim como o HTML, meu nível em CSS é avançado...', imgSrc: '/images/css.png' },
          { title: 'ReactJS', description: 'Iniciei meus estudos em ReactJS buscando eficiência no desenvolvimento...', imgSrc: '/images/react.png' },
          { title: 'React com TypeScript', description: 'Utilizo TypeScript para desenvolver aplicações mais robustas...', imgSrc: '/images/typescript.png' },
          { title: 'Bootstrap', description: 'Domino o Bootstrap para criar interfaces responsivas...', imgSrc: '/images/bootstrap.png' },
          { title: 'Redux', description: 'Utilizo Redux para gerenciar estados complexos em aplicações React...', imgSrc: '/images/redux.png' },
      ],
      backEnd: [
          { title: 'Node.js', description: 'Desenvolvo aplicações backend eficientes com Node.js e Express.js...', imgSrc: '/images/nodejs.png' },
          { title: 'Java', description: 'Experiência em desenvolvimento backend utilizando Java e Spring...', imgSrc: '/images/java.png' },
          { title: 'Python', description: 'Conhecimento em Python para desenvolvimento web e automação...', imgSrc: '/images/python.png' },
          { title: 'Docker', description: 'Utilizo Docker para empacotar e distribuir aplicações...', imgSrc: '/images/docker.png' },
          { title: 'Banco de dados - SQL', description: 'Experiência com bancos de dados SQL como MySQL e PostgreSQL...', imgSrc: '/images/sql.png' },
          { title: 'Deploy', description: 'Experiência em deploy de aplicações utilizando ferramentas modernas...', imgSrc: '/images/deploy.png' },
      ],
      communication: [
          { title: 'Git & Github', description: 'Utilizo Git e Github para controle de versão e colaboração eficiente...', imgSrc: '/images/github.png' },
          { title: 'Trello (Kanban + Scrum)', description: 'Uso Trello para gerenciar projetos utilizando metodologias ágeis...', imgSrc: '/images/trello.png' },
          { title: 'Postman', description: 'Utilizo o Postman para testar APIs e automatizar testes de integração...', imgSrc: '/images/postman.png' },
          { title: 'Cypress', description: 'Utilizo Cypress para testes automatizados de ponta a ponta...', imgSrc: '/images/cypress.png' },
          { title: 'Miro', description: 'Uso Miro para colaboração e brainstorming em equipe...', imgSrc: '/images/miro.png' },
      ],
  };

  const nextSlide = () => {
      setCurrentSlide((prev) => ({
          ...prev,
          [activeSection]: (prev[activeSection] + 1) % slides[activeSection].length,
      }));
  };

  const prevSlide = () => {
      setCurrentSlide((prev) => ({
          ...prev,
          [activeSection]: (prev[activeSection] - 1 + slides[activeSection].length) % slides[activeSection].length,
      }));
  };

  const handleSectionChange = (section) => {
      setActiveSection(section);
      setCurrentSlide((prev) => ({
          ...prev,
          [section]: 0,
      }));
  };

  return (
      <section id="competencias">
          <div className="wrapper">
              <header>
                  <h2>Habilidades Front-End</h2>
                  <nav>
                      <button onClick={() => handleSectionChange('frontEnd')}>Front-End</button>
                      <button onClick={() => handleSectionChange('backEnd')}>Back-End</button>
                      <button onClick={() => handleSectionChange('communication')}>Comunicação</button>
                  </nav>
              </header>

              <div className="carousel">
                  <button className="prev" onClick={prevSlide}>‹</button>
                  <div className="carousel-wrapper">
                      <div className="carousel-slide">
                          <img src={slides[activeSection][currentSlide[activeSection]].imgSrc} alt={slides[activeSection][currentSlide[activeSection]].title} />
                          <span>{slides[activeSection][currentSlide[activeSection]].title}</span>
                          <p>{slides[activeSection][currentSlide[activeSection]].description}</p>
                      </div>
                  </div>
                  <button className="next" onClick={nextSlide}>›</button>
              </div>
          </div>
      </section>
  );
};

export default Competence;
